import React, { Component } from "react";
import { useRouter } from "next/router";

export default class Case extends Component {
  constructor() {
    super();
    const router = useRouter();
    const { id } = router.query;
    this.state = {
      id
    };
  }
  render() {
    return <p>Case: {this.state.id}</p>;
  }
}
